import React from 'react';
import './IntroMessage.scss'

const IntroMessage = () => {
  return (
    <>
      <div className='message'>
            <div className='message__title'>Hello, don’t be afraid.</div>
            <div className='message__text'>This task is easier than looks like.<br/> It’s no magic, no quests and no math here. Only <b>your skill</b> in <b><i>semantic markup</i></b> matters. In this Figma design you already have everything to successfully path our test, just be attentive to details, take your time and GOOD LUCK.</div>
      </div>
     
    </>
  );
}

export default IntroMessage;
